import ExpenseItem from "./components/ExpenseItem";
import ExpensesData from "./components/ExpenseData";

function App() {
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem 
        title= {ExpensesData[0].title}
        amount={ExpensesData[0].amount}
        amount={ExpensesData[0].amount}
      />
    </div>
  );
}

export default App;
